import React from 'react';
import './ExpenseItem.css';

function ExpenseItem(props) {



    return (
        <div>
            { props.expenses.map(i => {


let date = {
    month: i.date.toLocaleString('en-US', {month: 'long'}),
    day: i.date.toLocaleString('en-US', {day: '2-digit'}),
    year: i.date.getFullYear(),

}

                return (



                    <div className='expense-item'>
                        <div>{date}</div>
                        <div className='expense-item__description'>
                            <h2>{i.title}</h2>
                            <div className='expense-item__price'>${i.amount}</div>
                        </div>
                    </div>
                )
            }
            )
            }
        </div>
    )
}

export default ExpenseItem;
